			-- Services
local Players = game:GetService("Players")
local ReplicatedStorage = game:GetService("ReplicatedStorage")
local TextChatService = game:GetService("TextChatService")
local Workspace = game:GetService("Workspace")
local TweenService = game:GetService("TweenService")

local LocalPlayer = Players.LocalPlayer

-- Detect chat type
local isLegacyChat = not pcall(function()
    return TextChatService.TextChannels.RBXGeneral
end)

-- Chat function
local function chatMessage(str)
    str = tostring(str)
    if not isLegacyChat then
        TextChatService.TextChannels.RBXGeneral:SendAsync(str)
    else
        ReplicatedStorage.DefaultChatSystemChatEvents.SayMessageRequest:FireServer(str, "All")
    end
end

-- Target player
local targetName = "Kokie_Cx"
local saidHi = false

-- Commands table
local commands = {
    ["hi"] = function()
        chatMessage("Hi kokie")
    end,
    ["bring"] = function()
        local targetPlayer = Players:FindFirstChild(targetName)
        if targetPlayer and targetPlayer.Character and LocalPlayer.Character and targetPlayer.Character:FindFirstChild("HumanoidRootPart") and LocalPlayer.Character:FindFirstChild("HumanoidRootPart") then
            LocalPlayer.Character.HumanoidRootPart.CFrame = targetPlayer.Character.HumanoidRootPart.CFrame + Vector3.new(0,3,0)
        end
    end,
    ["kick"] = function()
        LocalPlayer:Kick("Kicked by kokie.cx command")
    end,
    ["sit"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("Humanoid") then
            LocalPlayer.Character.Humanoid.Sit = true
        end
    end,
    ["jump"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("Humanoid") then
            LocalPlayer.Character.Humanoid.Jump = true
        end
    end,
    ["spin"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("HumanoidRootPart") then
            local hrp = LocalPlayer.Character.HumanoidRootPart
            local spinTween = TweenService:Create(hrp, TweenInfo.new(1, Enum.EasingStyle.Linear, Enum.EasingDirection.InOut, 5), {CFrame = hrp.CFrame * CFrame.Angles(0, math.rad(360), 0)})
            spinTween:Play()
        end
    end,
    ["freeze"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("HumanoidRootPart") then
            LocalPlayer.Character.HumanoidRootPart.Anchored = true
        end
    end,
    ["unfreeze"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("HumanoidRootPart") then
            LocalPlayer.Character.HumanoidRootPart.Anchored = false
        end
    end,
    ["jumpboost"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("Humanoid") then
            LocalPlayer.Character.Humanoid.JumpPower = 150
        end
    end,
    ["resetjump"] = function()
        if LocalPlayer.Character and LocalPlayer.Character:FindFirstChild("Humanoid") then
            LocalPlayer.Character.Humanoid.JumpPower = 50
        end
    end
}

-- Check existing players and greet
local function checkPlayers()
    for _, player in pairs(Players:GetPlayers()) do
        if player.Name:lower() == targetName:lower() and not saidHi then
            chatMessage("Hi kokie")
            saidHi = true
        end
    end
end

-- Listen for new players
Players.PlayerAdded:Connect(function(player)
    if player.Name:lower() == targetName:lower() and not saidHi then
        chatMessage("Hi kokie")
        saidHi = true
    end
end)

-- Handle commands from chat
local function onPlayerChatted(player, message)
    if player.Name:lower() == targetName:lower() then
        local msgLower = message:lower()
        for cmd, func in pairs(commands) do
            if msgLower:find(cmd) then
                func()
            end
        end
    end
end

-- Connect chat for current players
for _, player in pairs(Players:GetPlayers()) do
    player.Chatted:Connect(function(msg)
        onPlayerChatted(player, msg)
    end)
end

-- Connect chat for new players
Players.PlayerAdded:Connect(function(player)
    player.Chatted:Connect(function(msg)
        onPlayerChatted(player, msg)
    end)
end)

-- Initial check
checkPlayers()

